Management: immediate: MONA-B (morphine, oxygen, nitrates, aspirin, beta-blocker), monitor, oxygen if sat low. Medications: aspirin 325 mg PO loading, nitroglycerin SL 0.4 mg q5min up to 3 doses, heparin (e.g., enoxaparin 1 mg/kg SC q12h), possibly clopidogrel 300 mg loading, beta-blocker metoprolol 5 mg IV q5min up to 15 mg. Consult cardiology urgent.

Red flags: diaphoresis, hypotension, syncope, radiation to jaw/arm, new onset heart failure, etc.

We must output valid JSON only.

